#
#   Given NxM matrix where every cell have numerical code representing country.
#   Cell of country is adjusted by left\right\top\down cells only.
#   Find out number of countries for given matrix.
#

DEBUG = False

def bfs(y, x, A, visited, Y, X):
    current_code = A[y][x]
    current_country = []

    queue = [(y, x)]

    while queue:
        cur_y, cur_x = queue.pop()
        country_code = A[cur_y][cur_x]

        if country_code == 0:
            visited.add((cur_y, cur_x))
            continue

        if country_code == current_code and (cur_y, cur_x) not in visited:
            current_country.append((cur_y, cur_x))
            visited.add((cur_y, cur_x))

            if 0 < cur_y < Y - 1:
                queue.append((cur_y - 1, cur_x))
                queue.append((cur_y + 1, cur_x))
            elif cur_y == 0:
                queue.append((cur_y + 1, cur_x))
            elif cur_y == Y - 1:
                queue.append((cur_y - 1, cur_x))

            if 0 < cur_x < X - 1:
                queue.append((cur_y, cur_x - 1))
                queue.append((cur_y, cur_x + 1))
            elif cur_x == 0:
                queue.append((cur_y, cur_x + 1))
            elif cur_x == X - 1:
                queue.append((cur_y, cur_x - 1))

    return current_country


def solution(A):
    Y = len(A)

    if not Y:
        return 0

    X = len(A[0])

    if not X:
        return 0

    visited = set()

    countries = []

    for y in xrange(Y):
        for x in xrange(X):
            if (y, x) not in visited:
                countries.append(bfs(y, x, A, visited, Y, X))

    print(len(countries))
    if DEBUG:
        print(countries)



